import React from 'react';
import './App.css';
import back_image from './assets/images/img_background.jpg';

function App() {
    return (
        <div className="background">
            <img src={back_image} alt="back" className="background-image" />
        <div className="content"></div>
            <div className="header">
                <h1 className="header-title">水瀬いのり セッション会</h1>
            </div>
        </div>
    );
}

export default App;
